import Vue from 'vue'
import Router from 'vue-router'
import AppIndex from '@/components/home/AppIndex.vue'
import DeLu from "@/components/DeLu.vue";

Vue.use(Router)

export default new Router({
    mode: 'history',
    routes: [
        {
            path: '/login',
            name: 'DeLu',
            component: DeLu
        },
        {
            path: '/index',
            name: 'AppIndex',
            component: AppIndex
        },
        {
            path: '/',
            redirect: '/login' // 重定向到登录页面
        }
    ]
});
